export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:b,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:b,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:c,pageSize:25,pageCount:c,total:5}}},CwUxLVjQSX:{data:{id:682,attributes:{imdbId:"tt0360486",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODRiNmFhY2EtMGY2OC00YjI2LWIyYjQtYzFiM2ZhNjdhYzE4XkEyXkFqcGdeQXVyNDY5MTUyNjU@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"46%"},{Source:"Metacritic",Value:"50\u002F100"}],item_lang:{data:{id:1345,attributes:{title:d,plot:"John Constantine is approached by Det. Angela Dodson who needs his help to prove that her twin sister Isabel's death was not a suicide. The dead woman was a devout Catholic and Angela refuses to accept she would have taken her own life. She's asked Constantine for help because he has a reputation for dealing with the mystical. In fact, he is a demon hunter whose sole purpose on Earth is to send demons back to the nether regions. John himself has been to Hell and knows that he is destined to return there on his death - but hopes his good deeds may find him a place in Heaven. As he looks into Isabel's death, he realizes demons are trying to break through to the human world, and his battles lead him into a direct conflict with Satan.",slug:"constantine"}}},books:{data:[{id:4561,attributes:{title:"John Constantine, Hellblazer: 30th Anniversary Celebration",description:"Celebrate 30 years of one of DC Vertigo's most enduring and controversial characters in Hellblazer: A Celebration of 30 Years, an anthology graphic novel featuring his best tales to date! Plus, a forward written by worldwide musical icon, Sting! When all the chips are down and everything's on the line, what would you do to ensure you come out on top? What would you be willing to sacrifice? For occult detective John Constantine, the only thing more difficult than answering that question almost every single day is living with his decision. Whether it's due to a sense of self-loathing, a resistance to any sort of authority or a deeply hidden desire to do what's right, Constantine is willing to make the hard choices...so that no one else has to. All of these facets of John Constantine's character have made him one of the most popular in graphic literature since 1988. Hellblazer: A Celebration of 30 Years collects some of the antihero's best stories from some of the greatest writers in his history, including Alan Moore, Garth Ennis, Brian Azzarello, Paul Jenkins, Jamie Delano and more. Collects Saga of the Swamp Thing #37, John Constantine, Hellblazer #11, #27, #41, #63, #120, #146, #229 and #240.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=B2N1DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Alan Moore",e,f,g,"Paul Jenkins","Brian Azzarello"],firstBook:true,published:"2018-11-13",publisher:h,subtitle:i}},{id:4562,attributes:{title:"Black Crown Quarterly #1: Fall 2017",description:"Everything you always wanted once a season! Delight in regular continuing features like legit publications with literary pedigrees! It all begins with the 10-page regular lead feature, Tales From the Black Crown Pub starring Stacey the barmaid by Award-winner Rob Davis (The Motherless Oven). Recurring short features include Canonball Comics: an exquisite corpse that will not stay dead kicked off by Jamie Coe (Artschooled) and Swell Maps by respectably divine music journalist\u002Fnovelist Cathi Unsworth. Plus: Space CUDets rejoice: Live from a posh retirement village for wannabee 4-hit wonders we have co-writers\u002Fbandmates Will Potter and Carl Puttnam and occasional artist Philip Bond. Plus Plus: Special previews, creator interviews and behind the panel border secrets from Kid Lobotomy, Assassinistas, Punks Not Dead and much, much more!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_J4xDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Peter Milligan","Rob Davis","David Barnett","Tini Howard","Jamie Coe","Various"],firstBook:j,published:"2017-10-25",publisher:"IDW Publishing",subtitle:i}},{id:4563,attributes:{title:d,description:"\"In the City of Angels, Hell has always simmered just below the surface. At the shadowy border between this world and the next, John Constantine works to keep the demonic forces at bay. In the course of investigating a woman's apparent suicide, however, he discovers that something new is coming up from the inferno -- something that will destroy the delicate balance between Heaven and Hell and plunge Earth into catastrophic , other-worldly war. But can Constantine save a world which terminal cancer is about to take away from him -- especially when he knows his own soul is already condemned to eternal damnation?\"--Cover.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=x6mm3KHtBzwC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Steven T. Seagle",e,f,g],firstBook:j,published:"2005-01-01",publisher:h,subtitle:"The Hellblazer Collection"}}]}}},meta:{}}},prerenderedAt:1682568422934}}("movie","series",1,"Constantine","Jamie Delano","Neil Gaiman","Garth Ennis","Vertigo","",null))